import Link from 'next/link';

const Navbar = () => (
  <section>
    <div>
      <nav className="navbar">
        <div className="navbar-brand">
          <img src="https://bulma.io/images/bulma-logo.png" width="112" height="28"></img>
        </div>
      </nav>
    </div>
  </section>
);

export default Navbar;
